import React from 'react';
import Navbar from './Navber/Navbar'

const Header = () => {
    return (
        <div >
           <Navbar/>
            <div className="header-content">
                <h1>יום טוב שביט הנדסה אזרחית</h1>
            <img className="Header-img" src="./images/header.jpg" alt=""/>
            </div>
        </div>
    );
};

export default Header;
